import React from 'react';
import Home from '../Home';
import Presentation from './components/Presentation';
import Projects from './components/Projects';
import Skills from './components/Skills';
// import Experience from './components/Experience';

const Main = () => {
  return (
    <div className="container mx-auto px-4">
      <Home />
      <Presentation
        title="À propos de moi"
        description="Je suis un développeur passionné avec une expertise dans les technologies web modernes. J'aime créer des applications innovantes et trouver des solutions élégantes aux problèmes complexes."
        image="path/to/profile-image.jpg"
      />
      <Projects />
      <Skills
        title="Compétences"
        skills={[
          { name: 'React', level: 'Avancé' },
          { name: 'JavaScript', level: 'Avancé' },
          { name: 'HTML', level: 'Avancé' },
          { name: 'CSS', level: 'Avancé' },
          { name: 'Tailwind CSS', level: 'Avancé' },
        ]}
      />
      {/* <Experience /> */}
    </div>
  );
};

export default Main;
